import React from 'react';
import { motion, AnimatePresence } from 'framer-motion';

const Navbar = ({ isWhiteBackground }) => {
  const navItems = ['Services', 'About', 'Contact', 'Payment'];

  const navbarVariants = {
    hidden: { opacity: 0, y: -50 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: {
        duration: 0.5,
        when: "beforeChildren",
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: -20 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: { duration: 0.3 }
    }
  };

  return (
    <AnimatePresence>
      {isWhiteBackground && (
        <motion.nav 
          initial="hidden"
          animate="visible"
          exit="hidden"
          variants={navbarVariants}
          className="fixed top-0 left-0 right-0 bg-white p-4 z-50"
        >
          <ul className="flex justify-end space-x-8">
            {navItems.map((item) => (
              <motion.li 
                key={item}
                variants={itemVariants}
                className="text-xl font-light"
              >
                <a href={`#${item.toLowerCase()}`} className="hover:font-medium transition-all">
                  {item}
                </a>
              </motion.li>
            ))}
          </ul>
        </motion.nav>
      )}
    </AnimatePresence>
  );
};

export default Navbar;
